function addGoodsDel(){$(".goods_list").on("click",".to_del",function(){if(!confirm("Sure to delete?"))return!1;var i=$(this),o=i.parents(".goods_item"),t=parseInt(o.attr("goods_id"));return $.ajax({url:dataUrl.del+t,type:"post",dataType:"json",xhrFields:{withCredentials:!0},success:function(i){0==i.info.error?(alert("Deleted"),o.remove()):alert(i.info.message)},error:function(){alert("error")}}),!1})}function goodsInfoInit(){addGoodsDel()}dataFilter.list=function(i){if("undefined"!=typeof i.config&&"undefined"!=typeof i.config.list&&"undefined"!=typeof i.list)for(x in i.config.list)if("ico"==i.config.list[x].type&&"undefined"!=typeof i.config.list[x].option&&2==i.config.list[x].option.length&&-1!=i.config.list[x].option.indexOf(0)&&-1!=i.config.list[x].option.indexOf(1))for(y in i.list)i.list[y][i.config.list[x].key]=1==i.list[y][i.config.list[x].key]?"ok":"remove";else if("operation"==i.config.list[x].type)for(y in i.config.list[x].option)"link"==i.config.list[x].option[y].type&&(i.config.list[x].option[y].url=linkUrl[i.config.list[x].option[y].key]);return i},$(document).ready(function(){goodsInfoInit()});